import React from 'react';
import { LineChart } from '@mui/x-charts';
import './trend-graph.css';
import json_data from '../../mock/mock.json';

function TrendGraph() {
    return (
        <div className="trend-graph" >
            <LineChart
                xAxis={[
                    {
                        dataKey: 'year',
                        valueFormatter: (v) => v.toString(),
                        min: 1985,
                        max: 2022,
                    },
                ]}
                dataset={json_data}
            />
        </div>
    );
}

export default TrendGraph;
